(1, 0, 0, 'Новости', '2015-05-09', 0, '', '', '', '', 'novosti', '2015-05-09', '', '0.1'),
(2, 1, 6, 'Экспорт новостей', '2015-05-07', 0, '<p>Вы можете поставить на свой сайт заголовки и аннотации сюжетов Яндекс. Новостей, а также просматривать их с помощью любых программ и сервисов, совместимых с форматом RSS. Для удобства владельцев сайтов и домашних страничек созданы новостные информеры, установка которых не требует специальных знаний.</p>\r\n', '', '', '', 'eksport-novostej', '2015-05-09', '', '0.1'),
(3, 1, 6, 'Экспорт в формате RSS', '2015-05-09', 0, '<p>RSS &mdash; международный формат, специально созданный для трансляции данных с одного сайта на другой. Используя приведенные ниже экспортные файлы в формате RSS, вы можете разместить на своей странице заголовки и аннотации сюжетов Яндекс.Новостей. Кроме того, посредством RSS можно читать новости специальными программами &mdash; агрегаторами новостей &mdash; и таким образом оперативно узнавать об обновлениях нужных сайтов. Подробнее об RSS в каталоге Яндекса (общие сведения, спецификация, ссылки на ресурсы по теме)</p>\r\n', '', '', '', 'eksport-v-formate-rss', '2015-05-10', '', '0.1');
